        wiki: {
          published: '09 Jan 2019, 03:34',
          summary:
            'Twin Fantasy is the sixth album by American singer, songwriter, and multi-instrumentalist Will Toledo under the Car Seat Headrest moniker. Originally released on November 2nd, 2011, the album was recorded entirely by Toledo during his first semester at The College of William and Mary, inspired by a relationship the 19-year-old was in at the time. In subsequent years, Twin Fantasy would go on to become a cult hit, gaining traction through internet forums like 4chan and Reddit. <a href="http://www.last.fm/music/Car+Seat+Headrest/Twin+Fantasy">Read more on Last.fm</a>.',
          content:
            'Twin Fantasy is the sixth album by American singer, songwriter, and multi-instrumentalist Will Toledo under the Car Seat Headrest moniker. Originally released on November 2nd, 2011, the album was recorded entirely by Toledo during his first semester at The College of William and Mary, inspired by a relationship the 19-year-old was in at the time. In subsequent years, Twin Fantasy would go on to become a cult hit, gaining traction through internet forums like 4chan and Reddit.\n\nOn February 16th 2018, Car Seat Headrest, now a full band, released a fully re-recorded and re-worked version of the album, entitled Twin Fantasy (Face to Face), with the original now retitled to Twin Fantasy (Mirror to Mirror). In an interview with Peyton Thomas, Toledo noted that he had been planning to revisit the material for years, originally wanting to record the album in a studio, but having lacked the budget, resources and time. When asked about what informed the differences between the two, Toledo specified, "I spent time with different people, doing different things, and my understanding of my own life has changed. I don’t want to dismiss the things that were important to me in the past, but I want to reconcile them with how I’m living now." The re-recording was met with universal acclaim from critics upon release. \n\nBoth versions of the album are available through Matador Records and the official Car Seat Headrest Bandcamp. <a href="http://www.last.fm/music/Car+Seat+Headrest/Twin+Fantasy">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
        },
