            'Either/Or is the name of the third album recorded by American singer-songwriter Elliott Smith. The album was released on Kill Rock Stars on 25 February 1997 on compact disc and vinyl LP.\n\nThe title is derived from the Søren Kierkegaard book of the same name, reflecting Smith\'s interest in philosophy, something he studied (among other subjects) at Hampshire College in Massachusetts. Smith stated in a few interviews that the album follows the Kierkegaard <a href="http://www.last.fm/music/Elliott+Smith/Either%2FOr">Read more on Last.fm</a>.',
          content:
            'Either/Or is the name of the third album recorded by American singer-songwriter Elliott Smith. The album was released on Kill Rock Stars on 25 February 1997 on compact disc and vinyl LP.\n\nThe title is derived from the Søren Kierkegaard book of the same name, reflecting Smith\'s interest in philosophy, something he studied (among other subjects) at Hampshire College in Massachusetts. Smith stated in a few interviews that the album follows the Kierkegaard philosophy in relation with the absurdist struggle between choosing an aesthetic life and an ethical life.\n\n <a href="http://www.last.fm/music/Elliott+Smith/Either%2FOr">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
