        wiki: {
          published: '02 Sep 2020, 20:32',
          summary:
            'Chemtrails Over the Country Club is the seventh studio album by American singer-songwriter Lana Del Rey. It was released on March 19, 2021 by Interscope Records and Polydor Records. The album was produced by Del Rey and Jack Antonoff, and features additional production contributions from Rick Nowels, whom Del Rey worked with on past studio albums. A cover of Joni Mitchell\'s 1970 song "For Free", featuring American singer-songwriters Zella Day and Weyes Blood, is included in the album. <a href="http://www.last.fm/music/Lana+Del+Rey/Chemtrails+Over+the+Country+Club">Read more on Last.fm</a>.',
          content:
            'Chemtrails Over the Country Club is the seventh studio album by American singer-songwriter Lana Del Rey. It was released on March 19, 2021 by Interscope Records and Polydor Records. The album was produced by Del Rey and Jack Antonoff, and features additional production contributions from Rick Nowels, whom Del Rey worked with on past studio albums. A cover of Joni Mitchell\'s 1970 song "For Free", featuring American singer-songwriters Zella Day and Weyes Blood, is included in the album.\n\nIn a September 2020 interview with Interview magazine, Del Rey stated that "so much of the album" pertains to her "stunning girlfriends" and "beautiful siblings". A February 2021 interview with Del Rey, for the April 2021 issue of music magazine Mojo, stated "In 2021, [[i]Chemtrails over the Country Club] opens a sunnier chapter in [Del Rey\'s] controversial roman-à-clef, and folk legend Joan Baez advocates her acceptance in the pantheon", adding that the album "appears to reveal a more vulnerable Del Rey" who is "lighter on the LA menace" and "more innocently emotional" than in her previous work. <a href="http://www.last.fm/music/Lana+Del+Rey/Chemtrails+Over+the+Country+Club">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
        },
