          summary:
            'In Rainbows is the seventh studio album by the English alternative rock band Radiohead. It was first released on 10 October 2007 as a digital download that customers could order for whatever price they saw fit, followed by a standard CD release in most countries during the last week of 2007. The album was released in North America on 1 January 2008. In Rainbows was Radiohead\'s first release after the end of their contract with EMI and the end of the longest gap between studio albums in their career. <a href="http://www.last.fm/music/Radiohead/In+Rainbows">Read more on Last.fm</a>.',
          content:
            'In Rainbows is the seventh studio album by the English alternative rock band Radiohead. It was first released on 10 October 2007 as a digital download that customers could order for whatever price they saw fit, followed by a standard CD release in most countries during the last week of 2007. The album was released in North America on 1 January 2008. In Rainbows was Radiohead\'s first release after the end of their contract with EMI and the end of the longest gap between studio albums in their career.\n\nIn Rainbows was recorded in London, Somerset, Wiltshire and Oxfordshire with producers Mark Stent and Nigel Godrich. Radiohead worked on the songs for more than two years, beginning in early 2005. In between recording, the band toured Europe and North America for three months in 2006. Radiohead used a wide variety of musical styles on the album, incorporating string arrangements and electronic music, pianos, celestes and the ondes Martenot, yet renewing their focus on guitars, drums and bass as lead instruments. The songwriting on In Rainbows was more personal than that of Radiohead\'s other work, with singer Thom Yorke describing it as his attempt to write "seduction songs".\n\n Upon its retail release, In Rainbows entered the United World Chart, UK Album Chart, and the U.S. Billboard 200 at number one. In Rainbows also earned widespread critical acclaim, and several publications ranked it as one of the best albums of 2007. <a href="http://www.last.fm/music/Radiohead/In+Rainbows">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
