            "Sung Tongs is the fifth album by Baltimore-based band Animal Collective, released on May 3, 2004 by Fat Cat Records.\n\nDespite the name 'Animal Collective' attached to this album, only two of the band's four members play on it: Avey Tare (David Portner) and Panda Bear (Noah Lennox). As a result, Sung Tongs is a more stripped-down affair than other Animal Collective releases. On the album, Portner and Lennox both utilize acoustic guitars and tribal-like drums; the electric guitar <a href=\"http://www.last.fm/music/Animal+Collective/Sung+Tongs\">Read more on Last.fm</a>.",
          content:
            'Sung Tongs is the fifth album by Baltimore-based band Animal Collective, released on May 3, 2004 by Fat Cat Records.\n\nDespite the name \'Animal Collective\' attached to this album, only two of the band\'s four members play on it: Avey Tare (David Portner) and Panda Bear (Noah Lennox). As a result, Sung Tongs is a more stripped-down affair than other Animal Collective releases. On the album, Portner and Lennox both utilize acoustic guitars and tribal-like drums; the electric guitar, an important element in the Collective\'s previous album, Here Comes the Indian, is nowhere to be found. This sound brought the band closer to the psych folk and freak folk genres that critics tended to group them in around this period.\n\nSung Tongs is generally considered to be Animal Collective\'s breakthrough release; it generated much praise from critics upon its release and was frequently featured in best-of lists at the end of 2004.\n\nRecording\nOn the Collected Animals message board, Portner talks about the recording equipment:\n\n"Yeah, we recorded it on the same tascam 48 (half inch 8 track) that I recorded Spirit They\'re Gone, Spirit They\'ve Vanished on and the drums guitars and early electronics for Danse Manatee. That is we recorded the acoustic guitars and the vocals on 8 tracks. Then we mixed it down on Rusty\'s laptop and recorded many vocal and percussion over dubs. He\'s been using that for years. We mixed it from that onto....something..(i cant remember) at Noah\'s mom\'s place in Baltimore. It was very cold so we had to wear jackets the whole time. We added in all those samples and electronics there. We mixed for awhile so its sweet you like the mixing. Oh and we used AKGs and an old ribbon mike to record with. Though we had a pzm and some sm57s that we might have used as well. I remember using the pzm to record me slamming the door of the house which is what that distorted rhythm track in kids on holiday is. The person talking at the beginning of Who Could Win A Rabbit is someone in a deli in my neighborhood."\n\nMoreover, they used exclusively red light during the recording process. Portner explains at the same place:\n\n"Lots of singing and messing around with doing vocals in all parts of a room. It was basically like a two bedroom house but the living room was all cement...thats where we recorded and the bedroom was where we set up the mixer. Its on the property that my parents live on in lamar colorado. We rented a bunch of mikes here in nyc and took my eight track out there with us. Rusty [Santos] would just listen to every song as we would play it live and walk around the room for a while and then decide how he\'d want to mike the guitars. Noah and i both did the percussion during over dubs throughout the session as well."\n\nTrivia\nThe short track College with its line "You don\'t have to go to college" has often been mistaken as a political statement. "i just threw that line in there to make it funny and to be anti beachboys cause the song is so beach boys to begin with. You know its like the anti..be true to your school mentality of the fifties.", Dave Portner (aka Avey Tare) explained on the Collected Animals message board." The response to that song has been amazing. People at gigs scream for us to play it, and we get emails from kids asking for advice", Portner said in an Interview in 2005.\n\nThe song Visiting Friends was influenced by Kompakt’s Pop Ambient compilations and Wolfgang Voigt’s project Gas. It was meant to be "like a wall of hums [...], but with acoustic guitars."\n\nRecalling the recordings of the album\'s single  Who Could Win a Rabbit, Portner wrote on the Collected Animals Board: "The first time we played back who could win a rabbit after we recorded the initial tracks we just cracked up and said \'holy shit, we made that????....\' " <a href="http://www.last.fm/music/Animal+Collective/Sung+Tongs">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
