        wiki: {
          published: '26 Dec 2012, 21:57',
          summary:
            'Good Kid, M.A.A.D City (stylized as good kid, m.A.A.d city) is the second studio album by American hip hop recording artist Kendrick Lamar. The album was released on October 22, 2012, by Top Dawg Entertainment, Aftermath Entertainment, and distributed by Interscope Records.  The album serves as Lamar\'s major label debut, after his signing to Aftermath and Interscope in early 2012. It was preceded by the release of Kendrick\'s first studio album Section.80 (2011), released exclusively through iTunes independently. <a href="http://www.last.fm/music/Kendrick+Lamar/good+kid,+m.A.A.d+city">Read more on Last.fm</a>.',
          content:
            "Good Kid, M.A.A.D City (stylized as good kid, m.A.A.d city) is the second studio album by American hip hop recording artist Kendrick Lamar. The album was released on October 22, 2012, by Top Dawg Entertainment, Aftermath Entertainment, and distributed by Interscope Records.  The album serves as Lamar's major label debut, after his signing to Aftermath and Interscope in early 2012. It was preceded by the release of Kendrick's first studio album Section.80 (2011), released exclusively through iTunes independently.\n\nThe album was recorded mostly at several studios in California with producers such as, Dr. Dre, Just Blaze, Pharrell Williams, Hit-Boy, Scoop DeVille, Jack Splash and T-Minus, among others. Billed as a \"short film by Kendrick Lamar\" on the album cover, the concept album follows the story of a Lamar's teenage experiences in the drug infested streets and gang lifestyle of his native Compton, California. \n\nUpon its release, Good Kid, M.A.A.D City received rave reviews from music critics, who praised its thematic scope and Lamar's lyrics.  The album debuted at number two on the Billboard 200 chart, selling 242,000 copies in its first week – earning the highest first-week hip hop album sales of 2012 from a male artist, along with the best-selling debut from a male artist of the year. The album generated 2.8 million streams through Spotify, becoming the second highest first week stream total of the year.  It became Lamar's first album to enter the UK Albums Chart, peaking at number 16, and entering the UK R&B Albums Chart at number two. It was certified platinum by the Recording Industry Association of America (RIAA) and, by July 2013, had sold 980,000 copies, according to Nielsen SoundScan. <a href=\"http://www.last.fm/music/Kendrick+Lamar/good+kid,+m.A.A.d+city\">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.",
        },
