          summary:
            'Atrocity Exhibition is the fourth studio album by American rapper Danny Brown. It was released on September 27, 2016, by Warp Records. It is primarily produced by British producer Paul White. The album features guest appearances from Kendrick Lamar, Ab-Soul, Earl Sweatshirt, B-Real, Kelela and Petite Noir. Atrocity Exhibition received widespread acclaim from critics, appearing on the year-end lists of many publications and is considered to be one of the best albums of the 2010s. <a href="http://www.last.fm/music/Danny+Brown/Atrocity+Exhibition">Read more on Last.fm</a>.',
          content:
            'Atrocity Exhibition is the fourth studio album by American rapper Danny Brown. It was released on September 27, 2016, by Warp Records. It is primarily produced by British producer Paul White. The album features guest appearances from Kendrick Lamar, Ab-Soul, Earl Sweatshirt, B-Real, Kelela and Petite Noir. Atrocity Exhibition received widespread acclaim from critics, appearing on the year-end lists of many publications and is considered to be one of the best albums of the 2010s. The album was supported by four singles: "When It Rain", "Pneumonia", "Really Doe", and "Ain\'t It Funny".  <a href="http://www.last.fm/music/Danny+Brown/Atrocity+Exhibition">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
