        wiki: {
          published: '29 May 2019, 21:14',
          summary:
            'Considered one of the best works yet released by Danny Brown, this album is extremely raw hip-hop in its new school form. Mixing up deep violent and thin psychotic flows, this work goes hard from the beginning to the very end. The first half of the album is focused on The Hybrid persona, with a lot of sarcastic humor, misogyny, and maniac rhymes. At a certain point, the album get really depressive and serious, reminding us that Danny has been under a lot of pressure and extreme situations in his life, and he knows how to rap about it. <a href="http://www.last.fm/music/Danny+Brown/XXX+(Deluxe+Edition)">Read more on Last.fm</a>.',
          content:
            'Considered one of the best works yet released by Danny Brown, this album is extremely raw hip-hop in its new school form. Mixing up deep violent and thin psychotic flows, this work goes hard from the beginning to the very end. The first half of the album is focused on The Hybrid persona, with a lot of sarcastic humor, misogyny, and maniac rhymes. At a certain point, the album get really depressive and serious, reminding us that Danny has been under a lot of pressure and extreme situations in his life, and he knows how to rap about it. Funny fact is that the first word he says in the album is "30", in the opening song "XXX". In the last song, "30", the last thing he says, closing the record, is "Triple X". <a href="http://www.last.fm/music/Danny+Brown/XXX+(Deluxe+Edition)">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
        },
