          summary:
            'Bloom is the fourth studio album by Baltimore-based dream pop duo Beach House, which was released on May 15, 2012. The album debuted at number seven on the Billboard 200, selling 41,000 copies in its first week. The album was recorded at Sonic Ranch in Tornillo, Texas, and was co-produced by Chris Coady (Yeah Yeah Yeahs, Blonde Redhead), who also produced the band\'s previous album Teen Dream. Beach House chose to record in west Texas after being captivated by the area while resting there during a tour. <a href="http://www.last.fm/music/Beach+House/Bloom">Read more on Last.fm</a>.',
          content:
            'Bloom is the fourth studio album by Baltimore-based dream pop duo Beach House, which was released on May 15, 2012. The album debuted at number seven on the Billboard 200, selling 41,000 copies in its first week. The album was recorded at Sonic Ranch in Tornillo, Texas, and was co-produced by Chris Coady (Yeah Yeah Yeahs, Blonde Redhead), who also produced the band\'s previous album Teen Dream. Beach House chose to record in west Texas after being captivated by the area while resting there during a tour. Bloom was mixed at Electric Lady Studios in New York City. The album took seven weeks to record.\n <a href="http://www.last.fm/music/Beach+House/Bloom">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
