          summary:
            'Dummy is the 1994 debut album of the Bristol-based group Portishead. It reached #2 on the UK Album Chart and #79 on the Billboard 200 chart, going gold in 1997.\n\nBuilding on the promise of their earlier EP—"Numb"—it helped to cement the reputation of Bristol as the capital of Trip hop, a nascent genre which was then often referred to simply as "the Bristol sound".The cover is a still of Gibbons from the short film that the band created—To Kill a Dead Man—which originally got them signed due to their self composed soundtrack. <a href="http://www.last.fm/music/Portishead/Dummy">Read more on Last.fm</a>.',
          content:
            'Dummy is the 1994 debut album of the Bristol-based group Portishead. It reached #2 on the UK Album Chart and #79 on the Billboard 200 chart, going gold in 1997.\n\nBuilding on the promise of their earlier EP—"Numb"—it helped to cement the reputation of Bristol as the capital of Trip hop, a nascent genre which was then often referred to simply as "the Bristol sound".The cover is a still of Gibbons from the short film that the band created—To Kill a Dead Man—which originally got them signed due to their self composed soundtrack.\n\nIn addition to the already released "Numb", the album spawned two further singles: the UK #13  hit (on re-release) "Glory Box" and "Sour Times", which reached the same position, also on re-release.\n\nOn 3 December 2008, Universal Music Japan released Dummy and Portishead as limited SHM-CD versions. <a href="http://www.last.fm/music/Portishead/Dummy">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
