        wiki: {
          published: '02 Jul 2010, 14:59',
          summary:
            '"Jane Doe" is the fourth full-length studio album by American metalcore band Converge. The album is often considered Converge\'s masterpiece, and has been frequently described as one of the greatest metal/hardcore albums of all time by publications such as Rolling Stone, Decibel, and NPR Music. According to vocalist/lyricist Jacob Bannon, "the album\'s lyrical themes were born out of a dissolving relationship and the emotional fallout from that experience" <a href="http://www.last.fm/music/Converge/Jane+Doe">Read more on Last.fm</a>.',
          content:
            '"Jane Doe" is the fourth full-length studio album by American metalcore band Converge. The album is often considered Converge\'s masterpiece, and has been frequently described as one of the greatest metal/hardcore albums of all time by publications such as Rolling Stone, Decibel, and NPR Music. According to vocalist/lyricist Jacob Bannon, "the album\'s lyrical themes were born out of a dissolving relationship and the emotional fallout from that experience"\n\nIn January 2007, Decibel magazine certified the album number 35 in the "Decibel Hall of Fame", and later named it the best album of the \'00s. J. Bennett writes that "Jane Doe was both a semi-melodic milestone ("Hell to Pay", "Thaw", the title track) and a discordant landmark (everything else), far and away the most crucial metallic hardcore record since Cave In unleashed Until Your Heart Stops three years earlier", while Kerrang! stated "With feral blasting, extreme technicality, intense emotion and an overwhelmingly bleak tone... [Jane Doe is an] awe-inspiring listening experience..." On June 11, 2010, Sputnikmusic deemed Jane Doe the best album of the decade, earning the #1 spot on its top 100 albums of the decade list. <a href="http://www.last.fm/music/Converge/Jane+Doe">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
        },
