            "Led Zeppelin II is the second studio album by English rock band Led Zeppelin, released 22 October 1969 on Atlantic Records. Recording sessions for the album took place at several locations in the United Kingdom and North America from January to August 1969. Production was entirely credited to lead guitarist and songwriter Jimmy Page, while it also served as Led Zeppelin's first album to utilise the recording techniques of engineer Eddie Kramer. The album furthered the lyrical themes established on their debut album, Led Zeppelin (1969). This progress helped create a work that became more widely acclaimed and influential than its predecessor. With elements of blues and folk music, it also exhibits the band's evolving musical style of blues-derived material and their guitar and riff-based sound.\nUpon release, Led Zeppelin II earned a considerable amount of sales and was Led Zeppelin's first album to reach number one in the United Kingdom and United States. In 1970, art director David Juniper was nominated for a Grammy Award for Best Recording Package for Led Zeppelin II. On 15 November 1999, it was certified 12x platinum by the Recording Industry Association of America (RIAA) for sales in excess of 12 million copies. Following its initial reception, it has been recognized by writers and music critics as one of the greatest and most influential rock albums recorded. Led Zeppelin II has also been cited by critics as a blueprint for heavy metal bands that followed it. In 2003, the album was ranked number 75 on Rolling Stone magazine's list of the 500 greatest albums of all time. <a href=\"http://www.last.fm/music/Led+Zeppelin/Led+Zeppelin+II\">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.",
