            'Pornography is the fourth studio album by English rock band The Cure, released on 4 May 1982 by Fiction Records. Preceded by the non-album single "Charlotte Sometimes", it was the band\'s first album with new producer Phil Thornalley, and was recorded at RAK Studios from January to April 1982. The sessions saw the band on the brink of collapse, with heavy drug use, band infighting, and frontman Robert Smith\'s depression fueling the album\'s musical and lyrical content. <a href="http://www.last.fm/music/The+Cure/Pornography">Read more on Last.fm</a>.',
          content:
            "Pornography is the fourth studio album by English rock band The Cure, released on 4 May 1982 by Fiction Records. Preceded by the non-album single \"Charlotte Sometimes\", it was the band's first album with new producer Phil Thornalley, and was recorded at RAK Studios from January to April 1982. The sessions saw the band on the brink of collapse, with heavy drug use, band infighting, and frontman Robert Smith's depression fueling the album's musical and lyrical content. Pornography represents the conclusion of The Cure's early dark, gloomy musical phase, which began with their second album Seventeen Seconds (1980).\n\nFollowing its release, bassist Simon Gallup left the band, and The Cure switched to a much brighter and more radio-friendly new wave sound. Although it was poorly received by critics at the time of release, Pornography is The Cure's most popular album to date, reaching number eight on the UK Albums Chart. It has since gone on to gain acclaim from critics, and is now considered an important milestone in the development of the style of music known as gothic rock. <a href=\"http://www.last.fm/music/The+Cure/Pornography\">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.",
