            '1989 is the fifth studio album by American singer-songwriter Taylor Swift. It was released on October 27, 2014, through Big Machine Records. Swift began preparing for the album during the same year which Red was released, and during a significant amount of media scrutiny. Over the course of the two-year songwriting period, she primarily collaborated with producers Max Martin and Shellback—Martin served as the album\'s executive producer alongside Swift. <a href="http://www.last.fm/music/Taylor+Swift/1989+(Deluxe)">Read more on Last.fm</a>.',
          content:
            '1989 is the fifth studio album by American singer-songwriter Taylor Swift. It was released on October 27, 2014, through Big Machine Records. Swift began preparing for the album during the same year which Red was released, and during a significant amount of media scrutiny. Over the course of the two-year songwriting period, she primarily collaborated with producers Max Martin and Shellback—Martin served as the album\'s executive producer alongside Swift. Named after Swift\'s birth year, the album\'s title was inspired by the pop music scene of the 1980s.\n\nThe album represents a departure from the country music of her previous albums, and is described by Swift as her "first documented official pop album." In contrast to Swift\'s previous work, the production of 1989 consists of drum programming, synthesizers, pulsating bass, processed backing vocals, and guitars. 1989 received generally positive reviews from contemporary music critics and it was ranked as one of the best albums of 2014 by several publications, including Billboard, Time, and Rolling Stone. <a href="http://www.last.fm/music/Taylor+Swift/1989+(Deluxe)">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
