          content:
            'Abbey Road is the 11th studio album released by the English rock band The Beatles. It is their last recorded album, although Let It Be was the last album released before the band\'s dissolution in 1970. Work on Abbey Road began in April 1969, and the album was released on 26 September 1969 in the United Kingdom, and 1 October 1969 in the United States.\n\nAbbey Road is widely regarded as one of The Beatles\' most tightly constructed albums, although the band was barely operating as a functioning unit at the time. Despite the tensions within the band, Abbey Road was released to near universal acclaim and is considered to be one of the greatest albums of all time. In 2012, Abbey Road was voted 14th on Rolling Stone magazine\'s list of the "500 Greatest Albums of All Time". In 2009, readers of the magazine also named Abbey Road the greatest Beatles album. <a href="http://www.last.fm/music/The+Beatles/Abbey+Road">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
