        wiki: {
          published: '17 Jul 2008, 06:03',
          summary:
            'In the Aeroplane Over the Sea is the second and final studio album by the American indie rock band Neutral Milk Hotel. It was released in the United States on February 10, 1998 on Merge Records and May 1998 on Blue Rose Records in the United Kingdom.\n\nJeff Mangum moved from Athens, Georgia to Denver, Colorado to prepare the bulk of the album\'s material with producer Robert Schneider, this time at Schneider\'s newly created Pet Sounds Studio at the home of Jim McIntyre. <a href="http://www.last.fm/music/Neutral+Milk+Hotel/In+the+Aeroplane+Over+the+Sea">Read more on Last.fm</a>.',
          content:
            'In the Aeroplane Over the Sea is the second and final studio album by the American indie rock band Neutral Milk Hotel. It was released in the United States on February 10, 1998 on Merge Records and May 1998 on Blue Rose Records in the United Kingdom.\n\nJeff Mangum moved from Athens, Georgia to Denver, Colorado to prepare the bulk of the album\'s material with producer Robert Schneider, this time at Schneider\'s newly created Pet Sounds Studio at the home of Jim McIntyre.\n\nThe album was the sixth-best-selling vinyl album in 2008. NME named it the 98th greatest album of all time.\n\nIn the Aeroplane Over the Sea is widely considered to be written about Anne Frank due to lyrics seemingly referring to her, such as lines referring to her birth and death dates. Though the group has never officially stated that the album is indeed about Frank, it is a popular theory among fans, and Jeff Mangum has mentioned the influence her diary, The Diary of a Young Girl, has made on his craft and outright referred to "Holland, 1945" being about her while performing live. <a href="http://www.last.fm/music/Neutral+Milk+Hotel/In+the+Aeroplane+Over+the+Sea">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.',
        },
